import Grid from '@material-ui/core/Grid'
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import { Button } from 'reactstrap';
import '../static/scss/custom.scss';

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        width: '20vw',
        height: '25vh',
        marginLeft: '70vw',
        marginTop: '20vh'
    },
    background: {
        height: '80vh',
        overflow: 'hidden',
        zIndex: 1,
        width: '100vw',
        backgroundImage: `url(${"/static/img/frontpage1.jpg"})`
    },
    mainText: {
        fontFamily: 'Raleway',
        textAlign: 'center',
        marginTop: '20vh'
    }
}));

const Index = () => {
    const classes = useStyles();
    return (
        <div>
            <Grid container spacing={3}>
                <Grid item xs={12} className={classes.background}>
                    <h1 className={classes.mainText}>Ecommerce Collaboration Made Simple.</h1>
                    <p>Meet other ecommerce entrepreneurs and share products across sites with the click of a button</p>
                    <Paper className={classes.paper}>Sign Up for our Newsletter!</Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper>xs=6</Paper>
                </Grid>
                <Grid item xs={6}>
                    <Paper >xs=6</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                </Grid>
                <Grid item xs={3}>
                    <Paper >xs=3</Paper>
                    <Button color="danger">Danger!</Button>
                </Grid>
            </Grid>
        </div>
    );
};

export default Index;
